import random

def select(arr, custom):
	custom_reply_chance = 0.04
	if (random.random() < custom_reply_chance):
		return random.choice(custom)
	else:
		return random.choice(arr)

def compose(arr, custom):
	double_chance = 0.5
	ret = " " + select(arr, custom)
	
	if (random.random() < double_chance):
		ret += " i " + select(arr, custom)
	
	return ret



